var LIMITED = [
  "ジン", "トリトン", "ダゴン",
  "ワカン・タンカ∞", "タンガロア∞", "イスラフィール",
  "オルグス", "ソール", "ネクロス&バッカス",
  "アラクネ", "勇者", "ヤマサチヒコ", "オオグチマガミ",
  "チラマンテプ", "ルチャドール", "ナイトゴーント", "トリッカー"
];

function Card(index, id, name, variant, guilds, schools, e, x){
  var skills = e.map(function(s){
    return splitSkills(s);
  });
  this.index = index;
  this.id = id;
  this.name = name;
  this.variant = variant;
  this.rarity = x[0];
  this.maxLv = x[0] ? 45 + x[0] * 5 : 1;
  this.attribute = x[1];
  this.weapon = [x[2], x[3]];
  this.baseAtk = x[4] || 0;
  this.growth = new Fraction(x[5], 98);
  this.csBoost = x[6] || 0;
  this.guilds = guilds;
  this.schools = schools;
  this.effects = generateEffectData(skills[0], 0).concat(generateEffectData(skills[2], 1));
  this.tag = skills.map(function(s, i){
    return generateTagData(s, i);
  });
  this.limited = 1;
  if(!variant && LIMITED.indexOf(t(name, 0)) === -1) this.limited = 0;
}
Card.prototype = {
  toString: function(){
    var name = t(this.name) + t("/ ");
    if(!this.name) return "－";
    if(name[0] === "(") name = t(this.name, 0) + name;
    if(!this.growth.n) name = "× " + name;
    if(this.rarity < 3) return name + "(" + ATTRIBUTE[this.attribute] + ")";
    if(this.variant) return name + "(" + t(this.variant).slice(0, -2) + ")";
    return name + "☆" + this.rarity;
  },
  getValue: function(lv, enemy){
    if(enemy) return this.growth.add(this.baseAtk, 98).mul((lv || 1) - 1, 1).add(this.baseAtk, 1).round();
    return this.growth.mul((lv || 1) - 1, 1).add(this.baseAtk, 1).round();
  },
  canEquip: function(x){
    if(!this.index || !x.index) return true;
    if(x.chara.length && x.chara.indexOf(this.index) !== -1) return true;
    if(x.rarity & (1 << this.rarity)) return true;
    if(x.weapon & (1 << this.weapon[0])) return true;
    if(x.attribute & (1 << this.attribute)) return true;
    if(x.guilds & this.guilds) return true;
    if(x.schools & this.schools) return true;
    return false;
  }
};
Card.createList = function(a){
  var name = "";
  var guilds = "";
  var schools = "";
  var e = ["", "", "", "", "", ""];
  var ids = [];
  var table = new Map();
  var same = [];
  var result = a.map(function(v, i){
    var id = v.shift();
    var variant = "";
    if(ids.indexOf(id) !== -1) throw new Error("カードIDが重複しています（" + id + "）");
    ids.push(id);
    if(v[0] && v[0][0] !== "@"){
      name = v[0];
      guilds = splitGuildNames(v[1]);
      schools = splitSchoolNames(v[2]);
      same = [];
      if(v[9] > 2) table.set(t(name, 0), same);
    }else{
      variant = v[0].slice(1);
      guilds = v[1] ? splitGuildNames(v[1]) : guilds;
      schools = v[2] ? splitSchoolNames(v[2]) : schools;
      e.forEach(function(s, j){
        if(v[j + 3] === "*") v[j + 3] = s;
      });
    }
    same.push(i);
    e = v.slice(3, 9);
    return new Card(i, id, name, variant, guilds, schools, e, v.slice(9));
  });
  result.table = table;
  return result;
};
Card.csv = function(list, x){
  return list.map(function(v){
    if(!v.name){
      return t("#,レア度,名前,バージョン,限定,属性,武器タイプ,CSタイプ,CS倍率,基礎ATK,成長率*98,最大Lv,ATK(最大Lv),ATK(最大Lv+15),ダメージ補正,効果(自身),効果(味方),効果(敵),特攻,特防,状態無効,ギルド,学園/#,Rarity,Name,Variant,Limited,Attribute,WeaponType,CSType,CSRate,BaseATK,GrowthRate*98,MaxLv,ATK(MaxLv),ATK(MaxLv+10),DamageModifier,Effects(Self),Effects(Ally),Effects(Enemy),AttackBonus,DefenseBonus,NullifyStatus,Guilds,Schools", x);
    }else{
      var r = [
        v.index,
        v.rarity,
        t(v.name, x),
        t(v.variant, x),
        ["", "○"][v.limited],
        t(ATTRIBUTE[v.attribute].name, x),
        t(WEAPON[v.weapon[0]].name, x),
        t(WEAPON[v.weapon[1]].name, x),
        v.csBoost ? ("(+" + v.csBoost + ")").replace("+-", "-") : "",
        v.baseAtk,
        v.growth.muln(98),
        v.maxLv,
        v.getValue(v.maxLv),
        v.getValue(v.maxLv + 15),
        v.effects.map(function(n){
          return (n > EFFECT_MAX ? "{CS}" : "") + t(EFFECT[n % EFFECT_MAX].name, x)
        }).join("/")
      ];
      v.tag.forEach(function(z){
        r.push(z.map(function(a){
          var tag = TAG[a[0] % TAG_MAX];
          if(tag.type === TAG_TYPE.CATEGORY || !tag.reading) return 0;
          return timing2str(a[1], x, a[0] > TAG_MAX) + t(tag.name, x);
        }).filter(function(n){return n}).join("/"));
      });
      r.push(affs2array(GUILD, v.guilds, x).join("/"), affs2array(SCHOOL, v.schools, x).join("/"));
      return r.join(",");
    }
  }).join("\n");
};

